Saat ini tak ada parpol yg dpt diharapkan bikin cahaya demokrasi dan sistem politik Indonesia lbh baik ke dpn.

@PDI_Perjuangan ? Lha lht aja itu RUU TNI/Polri atau RUU Penyiaran 

